INSERT INTO `tbl_arg` (`rid`, `rstat`, `rprog`, `rcod`, `rdesc`, `rtext`, `rmostra`) VALUES
(3, '', 1, '', '', '', 1),
(4, '', 6, 'help', 'Help amministratore', '<h1>Aiuto per amministratore del sito&nbsp;</h1> \r\n<p>==================================================<br /></p> \r\n<p>&nbsp;</p>', 1);
INSERT INTO `tbl_art` (`aid`, `astat`, `aprog`, `atit`, `aalias`, `atext`, `aarg`, `acap`, `amostra`) VALUES
(51, '', 141, 'premessa', '', '<h3>1.Scopo</h3>\r\n<p>Creazione di siti WEB secondo una struttura a layout prestabilito, configurabile, con possibilita'' di variarne l''aspetto entro certi limiti,ma mantenendo inalterati i contenuti.</p>\r\n<p>&nbsp;</p>', 'help', 'cms', 0),
(52, '', 146, 'tabelle', '', '<h3><br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;<br /><span class="tit">Database di gestione</span></h3>\r\n<p><br />Attualmente esistono le tabelle:</p>\r\n<p><strong>login</strong>&nbsp;&nbsp; &nbsp;per gli utenti abilitati all''amministrazione  del sito</p>\r\n<p><strong>cfg</strong>&nbsp;&nbsp; &nbsp;per dati di configurazione generale<br /><br /><strong>tmp</strong>&nbsp;&nbsp; &nbsp;per dati dei templates<br /><br /><strong>mod</strong>&nbsp;&nbsp; &nbsp;per dati dei moduli e componenti</p>\r\n<p><strong>mnu</strong>&nbsp;&nbsp; per i menu principali di navigazione<br /><br /><strong>nav</strong>&nbsp;&nbsp; &nbsp;per le voci di menu''</p>\r\n<p>&nbsp;</p>\r\n<p><span style="text-decoration: underline;">Significato dei simboli sui pulsanti</span> :</p>\r\n<p><img style="vertical-align: middle; margin: 5px;" src="images/con_info.png" alt="info" width="16" height="16" />aiuto&nbsp;&nbsp;&nbsp;&nbsp; <img style="vertical-align: middle; margin: 5px;" src="images/new_f1.png" alt="nuovo" width="16" height="16" />nuovo&nbsp;&nbsp;&nbsp;&nbsp; <img style="vertical-align: middle; margin: 5px;" src="images/edit_f2.png" alt="edit" width="16" height="16" />modifica&nbsp;&nbsp;&nbsp;&nbsp; <img style="vertical-align: middle; margin: 5px;" src="images/cancel_f1.png" alt="cancella" width="16" height="16" />cancella</p>\r\n', 'help', 'database', 0),
(55, '', 161, 'layout', '', '<h3>Layout</h3>\r\n<p>&nbsp;Il template e'' strutturato secondo il seguente layout</p>\r\n<p><img style="float: left; width: 700px;" title="layout" src="images/lay.jpg" alt="lay" /></p>\r\n<p><br />&nbsp;Le zone gestite sono:</p>\r\n<dl><dt><strong>header</strong> con il logo del sito</dt>&nbsp;<dt><strong>navigatore</strong> menu'' per la navigazione nel sito</dt>&nbsp;<dt><strong>corpo</strong> zona centrale di colore grigio suddivisa a sua volta in 3 colonne che possono assumere il significato di:left/right/center a seconda di quanto &nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;stabilito dalla tabella tmp campi tcol1/2/3<br /></dt>&nbsp;<dt><strong>left e right</strong> per i moduli o componenti</dt>&nbsp;<dt><strong>center</strong> per i contenuti</dt>&nbsp;<dt><strong>footer</strong> per le informazioni di fondo pagina<br /></dt><dt><strong>subfooter</strong> per l''indicazione del creatore del template<br /></dt></dl>\r\n<p>Queste zone sono fisse per ogni template di questo tipo, e'' pero'' possibile alterare l''ordine del contenuto del corpo(left,center,right).</p>\r\n', 'help', 'cms', 0),
(56, '', 166, 'cartelle', '', '<h3><span class="tit">Cartelle</span><br /><br /><br />&nbsp;&nbsp;&nbsp; &nbsp;<br /><img style="float: left; margin: 5px;" title="layout" src="images/path1.jpg" alt="folders" width="181" height="234" /></h3>\r\n<p><br />Le cartelle dell''applicazione sono strutturate come da figura.<br /><strong>component</strong> contiene i componenti<br /><br /><strong>Funct</strong> contiene le funzioni PHP<br /><br /><strong>images</strong> contiene le immagini<br /><br /><strong>moduli</strong> contiene i moduli PHP<br /><br /><strong>testi</strong> contiene il testo degli articoli<br /><br /></p>\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;a sua volta la cartella <strong><em>administrator</em></strong> ha la seguente struttura:</p>\r\n<p><img style="margin: 5px;" src="images/path2.jpg" alt="path2" width="191" height="162" /></p>\r\n<p>e la cartella <strong><em>templates</em></strong> la seguente:</p>\r\n<p><img style="vertical-align: text-top; margin: 5px;" src="images/path3.jpg" alt="path3" width="191" height="162" />chiaramente contiene tante cartelle quanti sono i templates installati.</p>\r\n<p>&nbsp;</p>', 'help', 'cms', 0),
(57, '', 171, 'contenuti', '', '<h3><span style="color: rgb(153, 51, 0);" class="tit">Contenuti o articoli</span></h3> \r\n<p>&nbsp;Sono di tipo testuale, eventualmente corredati da immagini e link, memorizzati in record di database. Quando si visualizza la pagina il contenuto letto dal database &egrave; messo a video e formattato secondo appositi fogli di stile.</p> \r\n<p>Esempio di contenuto:<br /></p> \r\n<ul>&nbsp;\r\n</ul> \r\n<p><img width="500" height="215" alt="testo" style="vertical-align: bottom; display: block; margin-top: 5px; margin-bottom: 5px; width: 500px; height: 215px;" src="http://localhost/local_html/nuovo/spaw2/uploads/images/testo.jpg" /> </p>', 'help', 'cms', 0),
(58, '', 176, 'componenti', '', '<h3><br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;<br /><span class="tit">Componenti</span></h3>\r\n<p><br />I componenti sono contenuti particolari che eseguono una funzione particolare, quelli inseriti sono:<br /><br /><strong>gallery.php</strong>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;per visualizzare le gallery di fotografie di Picasa<br /><br /><strong>video.php</strong>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;per visualizzare video di YouTube <br /><br />ricevono entrambi come variabile il codice assegnato da Google per Picasa e da YouTube che viene inserito nell''url per la visualizzazione. Dimensioni dell''embed sono per ora fissi mentre colori e bordi dei video sono tabellati nell''archivio tmp (templates) del database.<br />Questi componenti sono lanciati&nbsp; da un link e visualizzati in un iframe in posizione center.</p>', 'help', 'cms', 0),
(59, '', 181, 'moduli', '', '<h3><span style="color: rgb(153, 51, 0);">I moduli</span></h3> \r\n<p>Servono a posizionare un contenuto in una pagina relativa ad una scelta dal menu di navigazione e possono essere di vari tipi:</p> \r\n<ul> \r\n  <li>box per menu</li> \r\n  <li>box per link</li> \r\n  <li>navigatore principale</li> \r\n</ul> \r\n<p><strong><br />b)</strong> testo incastonato in un contorno di tipo <strong><em>fieldset con legend</em></strong> il cui stile e'' descritto nel CSS del template </p> \r\n<ul>&nbsp;\r\n</ul> \r\n<p><img width="190" height="109" alt="" style="vertical-align: bottom; display: block; margin-top: 5px; margin-bottom: 5px; width: 190px; height: 109px;" src="http://localhost/local_html/nuovo/spaw2/uploads/images/fieldset.jpg" /> <strong><br /><br />c)</strong> testo incastonato in un contorno di tipo <em><strong>box con titolo</strong></em> in evidenza il cui  stile e'' descritto nel CSS del template</p> \r\n<ul>&nbsp;\r\n</ul> \r\n<p><img width="192" height="176" alt="box" style="vertical-align: bottom; display: block; margin-top: 5px; margin-bottom: 5px; width: 192px; height: 176px;" src="http://localhost/local_html/nuovo/spaw2/uploads/images/box.jpg" /></p> \r\n<ul>&nbsp;\r\n</ul> \r\n<p>&nbsp;</p> <h3><span style="text-decoration: underline;">Inserimento di un fieldset</span></h3> \r\n<p>Creare il testo fornendo il nome e compilando il contenuto tenendo \r\npresente che in caso di link a parole di testo si opera cosi'':</p> \r\n<p>in caso di link testuali:</p> \r\n<ul> \r\n  <li>scrivere il testo</li> \r\n  <li>selezionarlo</li> \r\n  <li>cliccare sulla catena per far apparire la mappa del link</li> \r\n</ul> \r\n<p><img width="320" height="288" alt="link" style="float: left; margin: 5px; width: 320px; height: 288px;" src="http://localhost/local_html/nuovo/spaw2/uploads/images/tiny-link.jpg" />fornire l''url, il target come in figura e dare un titolo che appare quando il mouse si trova sopra il collegamento.</p> \r\n<p>&nbsp;</p> \r\n<p>&nbsp;</p> \r\n<p>&nbsp;</p> \r\n<p>&nbsp;</p> \r\n<p>&nbsp;</p> \r\n<p>&nbsp;</p> \r\n<p>&nbsp;</p> \r\n<p>&nbsp;</p> \r\n<p>&nbsp;</p> \r\n<p>&nbsp;</p> \r\n<p>&nbsp;</p> \r\n<ul> \r\n  <li>salvare il testo</li> \r\n</ul> \r\n<p>quindi andare in gestione moduli e compilarne uno nuovo</p> \r\n<p><img width="650" height=" " alt="moduli" style="vertical-align: top; margin: 5px;" src="http://localhost/local_html/nuovo/spaw2/images/moduli.jpg" /></p> \r\n<p>specificando:</p> \r\n<ol> \r\n  <li>tipo = <strong><span style="font-size: small; color: rgb(128, 0, 0);">fxt</span></strong></li> \r\n  <li>menu e voce che fa apparire il modulo</li> \r\n  <li>posizione desiderata</li> \r\n  <li>contenuto = nome del testo preparato in precedenza</li> \r\n  <li>descrizione = testo che appare nella <strong><em>legend</em></strong> del <strong><em>fieldset</em></strong></li> \r\n  <li>target da indicare se richiesto dalla pagina da visualizzare</li> \r\n</ol> \r\n<p>nel caso di link con immagine la si inserisce invece del testo ed il rimanente e'' uguale,</p> \r\n<ol>&nbsp;\r\n</ol> <h3><span style="text-decoration: underline;">Inserimento di un box</span></h3> \r\n<p>Si opera in modo simile al fieldset con la differenza che al punto 1 si scrive <strong><span style="color: rgb(128, 0, 0); font-size: small;">bxt </span></strong>ed il testo al punto 5&nbsp; appare nel titolo evidenziato.</p> <h3><span style="text-decoration: underline;">Inserimento di un testo</span></h3> \r\n<p>Si opera in modo simile al fieldset con la differenza che al punto 1 si  scrive <span style="color: rgb(128, 0, 0); font-size: small;"><strong>txt</strong></span> ed il titolo si scrive all''inizio del testo.</p> <h3><span style="text-decoration: underline;">Casi particolari</span></h3> \r\n<p><span style="text-decoration: underline;">Nel caso di banner</span> \r\ndi Google AdSense inserire un layer quindi portarsi in editore HTML ed  \r\nincollare al suo interno i dati ricevuti da Google (Javascript).</p> \r\n<p><span style="text-decoration: underline;">Nel caso di video</span> di  YouTube usare come link il seguente:<br /><strong>index.php?form=<span style="color: rgb(0, 128, 0);">musica</span>&amp;pagina=<span style="color: rgb(51, 102, 255);">1</span>&amp;video=<span style="color: rgb(255, 0, 0);">d50kGmSY2Gw</span>&amp;colonna=center</strong><br />dove\r\n  la scritta in rosso e'' il codice del video fornito da YouTube, la \r\nscritta in verde e'' la voce di menu e la scritta in blu e'' zero se il \r\nmenu e'' ad un livello altrimenti il numero e'' il livello (Il resto  e'' \r\ncostante).</p> \r\n<p><span style="text-decoration: underline;">Nel caso di gallery</span> di Picasa usare come link il seguente:<br /><strong>index.php?form=<span style="color: rgb(0, 128, 0);">turismo</span>&amp;album=<span style="color: rgb(255, 0, 0);">2F5341997916489681345</span>&amp;colonna=center</strong><br />dove\r\n  la scritta in rosso e'' il codice del video fornito da Picasa e la \r\nscritta in verde e'' la voce di menu(Il   resto e'' costante).</p> <h3><span style="color: rgb(255, 0, 0);">NB:</span></h3> \r\n<p>Per i fieldset e box testuali si possono esprimere link <strong>solo senza parametri</strong> altrtimenti i caratteri "&amp;" vengono convertiti automaticamente in "&amp;" rendendo il link impossibile!</p> \r\n<ul>&nbsp;\r\n</ul>', 'help', 'cms', 0),
(60, '', 186, 'utenti', '', '<h3>Tabella utenti</h3>\r\n<p>Inserire il nome utente e password che viene criptata con la funzione <strong>PHP md5()</strong> ; solo per gli utenti presenti in tabella e'' possibile collegarsi come amministratori del template.</p>\r\n', 'help', 'database', 0),
(61, '', 191, 'menu', '', '<h3>Tabella menu</h3>\r\n<p><strong>Progr:</strong> progressivo per ordinamento<br /><strong>St:</strong> stato record: "A" = annullato/sospeso<br /><strong>Nome:</strong> nome del menu per raggruppare le voci che lo compongono</p>\r\n<p><strong>Tipo:</strong> definisce il tipo di menu da scegliere fra i seguenti:</p>\r\n<ul>\r\n<li>ul1 menu a blocco orizzontale/verticale ad 1 figura con CSS, le cui voci sono scritte sul database voci di menu</li>\r\n<li>ul2 menu a blocco orizzontale/verticale ad 2 figure con CSS, le cui voci  sono scritte sul database voci di menu</li>\r\n<li>txt&nbsp;&nbsp;&nbsp;&nbsp; menu testuale senza bordi</li>\r\n<li>bxt&nbsp;&nbsp;&nbsp;&nbsp; menu testuale con bordo e testata di tipo "box"</li>\r\n<li>fxt&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; menu testuale in un bordo di tipo "fieldset"</li>\r\n<li>box&nbsp;&nbsp;&nbsp;&nbsp; menu contenuto in un box, le cui voci sono scritte sul database voci di menu</li>\r\n<li>fld&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; menu contenuto in un fieldset, le cui voci sono scritte sul database voci di  menu</li>\r\n</ul>\r\n<p><strong>Descrizione:</strong> puramente descrittiva tranne per i menu di tipo: <strong><span style="color: #800000;">box</span></strong> e<strong><span style="color: #800000;"> fld</span></strong> per i quali diventa la descrizione della testata.</p>\r\n', 'help', 'database', 0),
(62, '', 196, 'voci', '', '<h3>Tabella voci di menu</h3>\r\n<h4>Descrizione campi</h4>\r\n<p><span style="text-decoration: underline;">progressivo</span> per ordinare le voci</p>\r\n<p><span style="text-decoration: underline;">stato</span> "A" = annullato</p>\r\n<p><span style="text-decoration: underline;">menu</span> menu di appartenenza della voce</p>\r\n<p><span style="text-decoration: underline;">voce</span> label voce di menu</p>\r\n<p><span style="text-decoration: underline;">comando</span> comando che viene eseguito cliccando sulla voce</p>\r\n<p><span style="text-decoration: underline;">target</span> destinazione della pagina (se previsto)</p>\r\n<p><span style="text-decoration: underline;">descrizione voce</span> puramente descrittiva</p>\r\n<p><span style="text-decoration: underline;">sel</span> 1=voce selezionata, 0=no</p>\r\n', 'help', 'database', 0),
(63, '', 201, 'moduli', '', '\r\nTabella moduli\r\n\r\nDefinisce il posizionamento di menu e contenuti nella pagina.\r\nLa pagina e&#39; suddivisa in zone chiamate moduli, come si evince dal layout, che rappresentano appunto le posizioni disponibili per accogliere i contenuti.\r\n \r\n', 'help', 'database', 0),
(64, '', 206, 'templates', '', '<h3>Tabella dei templates</h3>\r\n<h4>Descrizione campi</h4>\r\n<p><span style="text-decoration: underline;">Pr:</span> progressivo per  ordinare<br /><span style="text-decoration: underline;">S:</span> "A" =  annullato<span style="text-decoration: underline;"><br />*:</span> "*" = template selezionato, quindi attivo <br /><span style="text-decoration: underline;">Tp:</span> tipo (non usato) <span style="text-decoration: underline;"><br /> Menu:</span> nome menu di navigazione (tabella menu)<br /><span style="text-decoration: underline;">Path:</span> percorso della cartella che contiene i programmi specifici del template<br /><span style="text-decoration: underline;">Descriz.:</span> descrizione template<br /><span style="text-decoration: underline;">Col.1:</span> nome della prima colonna da sinistra del corpo pagina, puo'' essere: left,center,right <br /><span style="text-decoration: underline;">Col.2:</span> nome della seconda colonna da sinistra del corpo pagina, puo'' essere:  left,center,right <br /><span style="text-decoration: underline;">Col.3:</span> nome della terza colonna da sinistra del corpo pagina, puo'' essere:  left,center,right <br /><span style="text-decoration: underline;">Pos.:</span> posizione del menu di navigazione<br /><span style="text-decoration: underline;">Box:</span> "B" = box<br /><span style="text-decoration: underline;">Color.1:</span> colore chiaro del bordo dei video di YouTube<br /><span style="text-decoration: underline;">Color.2:</span> colore scuro del bordo dei video di YouTube<br /><span style="text-decoration: underline;">Bor:</span> "1" = il video e'' bordato, "0" invece no<br /><br /></p>\r\n', 'help', 'database', 0),
(66, '', 216, 'cambio_template', '', '<p><h3>Cambio template</h3>\r\n<br />Dal menu'' amministratore scegliere <strong>varia_templates </strong>quindi selezionare dalla casella a discesa il template desiderato e confermare.<br />Basta uscire dall''amministrazione del sito per vedere il template scelto.</p>\r\n', 'help', 'faq', 0),
(68, '', 226, 'changelog', '', '<h3>Changelog</h3>\r\n<h3>Modifiche a partire dalla versione 2.0</h3>\r\n<p>&nbsp;&nbsp; * possibilit&agrave; di assegnare header specifico per template, basta creare nella cartella moduli<br >&nbsp;&nbsp; * del template uno script=header.php e si usa quello invece di quello standard nella cartella<br >&nbsp;&nbsp; * moduli della root.&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;<br >&nbsp;&nbsp; * Header legato alla voce di menu, ognuna pu&ograve; avere header specifico (fino a 9) in base al <br >&nbsp;&nbsp; * contenuto di "nhead" della tabella "nav" (Campo aggiunto alla tabella). Se =0 si usa lo <br >&nbsp;&nbsp; * standard altrimenti si usa il modulo con suffisso _numero (da 1 a 9).Creare tanti header_numero<br >&nbsp;&nbsp; * quanti sono quelli usati in "nav".&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n<p>&nbsp;</p>', 'help', 'faq', 0),
(69, '', 231, 'inserimento_articoli', '', '<h3>Inserimento degli articoli</h3>\r\n<p>Pe inserire un testo relativo ad un articolo:</p>\r\n<p><img style="vertical-align: top;" title="img-gest" src="http://www.fael.net/administrator/images/art_gest.jpg" alt="ig" width="438" height="185" ><img title="bottoni" src="http://www.fael.net/administrator/images/art_bott.jpg" alt="bot" width="290" height="80" ></p>\r\n<p>Eseguiure da men&ugrave;:&nbsp;<strong> contenuti -&gt; articoli</strong> -&gt; <strong>Nuovo</strong><br >assegnare i dati nella mappa sottostante<br ><img style="margin-top: 10px; margin-bottom: 10px;" title="art-dati" src="http://www.fael.net/administrator/images/art_dati.jpg" alt="dati" width="740" height="178" ><strong> <br ></strong>utilizzando l''editor Tiny-mce scriverne il contenuto e salvare.</p>\r\n<p><img title="testo" src="http://www.fael.net/administrator/images/art_testo.jpg" alt="te" width="734" height="106" ></p>\r\n<h3>Per farlo apparire in una pagina:</h3>\r\n<p>si inserisce una voce del menu (<strong>voci_menu</strong>) specificandone prima il tipo = "art", quindi salvare, alla prossima mappa selezionare l''articolo appena inserito dalla casella a discesa.</p>', 'help', 'faq', 0),
(70, '', 236, 'installazione', '', '<h2>Installazione di un template "open template"</h2>\r\n<h3>Prerequisiti minimi</h3>\r\n<p>ambiente: Windows XP</p>\r\n<p>server:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; con installato PHP 5.3 e MYSQL</p>\r\n<p>internet:&nbsp;&nbsp;&nbsp; collegamento ADSL e Mozilla Firefox</p>\r\n<h3>Ambiente CMS</h3>\r\n<p>Nome del sito = nome cartella principale appesa alla root.<br />Caricare i dati di download.<br />Scrivere nel file <strong>config.ini</strong> i dati di configurazione di base che riguardano principalmente:</p>\r\n<ul>\r\n<li>connessione al database mysql</li>\r\n<li>dati costanti utilizzati dai programmi</li>\r\n</ul>\r\n<p>Predisporre un form per l''inserimento dei dati secondo lo schema:</p>\r\n<p><strong>Creazione cartella del sito</strong></p>\r\n<p>Nome del sito&nbsp; .....................<br />path immagini .....................<br />path dell''help&nbsp; .....................<br />incremento <br />riga inserimento .................. <br /><strong>CARICA---&gt;</strong></p>\r\n<p><strong>Creazione database</strong></p>\r\n<p>nome database ...................<br />utente&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ...................<br />password&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ...................</p>\r\n<p><strong>CARICA---&gt;&nbsp; </strong>[lancia PHP di creazione del database di base]</p>\r\n<p>&nbsp;</p>\r\n<h3>Dati esempio</h3>\r\n<p>Configurazione minima del DB (tabelle e dati) per poter visualizzare una struttura di base cosi'' costituita:</p>\r\n<p>Tab.HOME</p>\r\n<ol>\r\n<li>txt centrale</li>\r\n<li>txt laterale</li>\r\n<li>fxt con gallery</li>\r\n<li>bxt con video</li>\r\n</ol>\r\n<p>Tab.INFO</p>\r\n<ol>\r\n<li>txt con about e dati anagrafici o link</li>\r\n</ol>\r\n', 'help', 'faq', 0),
(71, '', 221, 'note_tecniche', '', '<h3>Note tecniche</h3>\r\n<h4>Variabili non globali</h4>\r\n<p>form&nbsp;&nbsp;&nbsp; nome della voce di men&ugrave; che corrisponde alla pagina visualizzata <br >video&nbsp;&nbsp; se valorizzata la memorizza in iframe per la gestione dei video di YouTube<br >gallery se valorizzata la memorizza in iframe per la gestione delle gallery di Picasa</p>', 'help', 'faq', 0),
(72, '', 241, 'bottoni', '', '<h2><img style="margin-left: 10px; margin-right: 10px; vertical-align: baseline;" title="classe" src="http://localhost/nuovo/administrator/images/class.png" alt="class" width="16" height="16" >bottoni</h2>\r\n<h3>variabili</h3>\r\n<p><img style="margin-left: 10px; margin-right: 10px;" title="var" src="http://localhost/local_html/nuovo/administrator/images/Variable.png" alt="var" width="16" height="16" > <strong>valore</strong> &nbsp; parametro: tipo operazione(ins/mod/canc/uscita/salva). Tale parametro diventa il valore che la submit passa al programma chiamato.</p>\r\n<h3>Metodi</h3>\r\n<pre><strong><img style="margin-left: 10px; margin-right: 10px;" title="constr" src="http://localhost/local_html/nuovo/administrator/images/Constructor.png" alt="con" width="16" height="16" >__constructor()</strong>        metodo <strong>costruttore</strong> con parametro<strong> valore<br ><img style="margin-left: 10px; margin-right: 10px;" title="met" src="http://localhost/local_html/nuovo/administrator/images/Method.png" alt="m" width="16" height="16" >bt_nuovo()</strong>              crea bottone <strong>Nuovo</strong> parametro ins<strong><br ><img style="margin-left: 10px; margin-right: 10px;" title="mm" src="http://localhost/local_html/nuovo/administrator/images/Method.png" alt="m" width="16" height="16" >bt_mod()</strong>                crea bottone <strong>Modifica</strong> parametro mod<strong><br ><img style="margin-left: 10px; margin-right: 10px;" title="mm" src="http://localhost/local_html/nuovo/administrator/images/Method.png" alt="m" width="16" height="16" >bt_canc()</strong>               crea bottone <strong>Cancella</strong> parametro canc<strong><br ><img style="margin-left: 10px; margin-right: 10px;" title="mm" src="http://localhost/local_html/nuovo/administrator/images/Method.png" alt="m" width="16" height="16" >bt_uscita()</strong>             crea bottone<strong> Uscita</strong> parametro uscita<strong><br ><img style="margin-left: 10px; margin-right: 10px;" title="mm" src="http://localhost/local_html/nuovo/administrator/images/Method.png" alt="m" width="16" height="16" >bt_salva()</strong>              crea bottone <strong>Salva</strong> parametro salva<strong><br ><img style="margin-left: 10px; margin-right: 10px;" title="mm" src="http://localhost/local_html/nuovo/administrator/images/Method.png" alt="m" width="16" height="16" >bt_help()</strong>               crea bottone <strong>Aiuto</strong> parametro nome file di help</pre>', 'help', 'cla', 0),
(76, '', 251, 'info', '', '<h3>FB open template</h3> \r\n<p>Il CMS <strong>FB open template</strong> permette la creazione di siti web secondo una struttura a layout prestabilito, configurabile, con possibilit&agrave; di variarne l''aspetto entro certi limiti, mantenendo invariato il contenuto.</p>', '', '', 0),
(77, '', 256, 'capitolo', '', '<p>--- Inserire qui il testo ---<img style="width: 136px; height: 136px;" src="http://localhost/local_html/nuovo/spaw2/uploads/images/capitoli.jpg" alt="" width="136" height="136" border="0" ></p>', '', '', 0);
